apiVersion: #<string>
kind: #<string>
metadata: #<Object>
  annotations: #<map[string]string>
  clusterName: #<string>
  creationTimestamp: #<string>
  deletionGracePeriodSeconds: #<integer>
  deletionTimestamp: #<string>
  finalizers: #<[]string>
  generateName: #<string>
  generation: #<integer>
  labels: #<map[string]string>
  managedFields: #<[]Object>
    apiVersion: #<string>
    fieldsType: #<string>
    fieldsV1: #<map[string]>
    manager: #<string>
    operation: #<string>
    subresource: #<string>
    time: #<string>
  name: #<string>
  namespace: #<string>
  ownerReferences: #<[]Object>
    apiVersion: #<string>
    blockOwnerDeletion: #<boolean>
    controller: #<boolean>
    kind: #<string>
    name: #<string>
    uid: #<string>
  resourceVersion: #<string>
  selfLink: #<string>
  uid: #<string>
spec: #<Object>
  constraints: #<Object>
    container: #<[]Object>
      name: #<string>
      requests: #<Object>
        maxAllowed: #<>
        minAllowed: #<>
    containerControlledResources: #<[]string>
    global: #<Object>
      maxReplicas: #<integer>
      minReplicas: #<integer>
      requests: #<Object>
        maxAllowed: #<>
        minAllowed: #<>
    pod: #<Object>
      requests: #<Object>
        maxAllowed: #<>
        minAllowed: #<>
  goals: #<Object>
    metrics: #<[]Object>
      resource: #<Object>
        name: #<string>
        target: #<Object>
          averageUtilization: #<integer>
          averageValue: #<>
          type: #<string>
          value: #<>
      type: #<string>
  policy: #<Object>
    updateMode: #<string>
  scaleTargetRef: #<Object>
    apiVersion: #<string>
    kind: #<string>
    name: #<string>
status: #<>
